import React from 'react';
import classNames from 'classnames';
import type { LogoProps, LogoSize } from '@/app/ui/components';

// Generate ClassName for Logo size
const logoSize: Record<LogoSize, string> = {
  small: 'logo-sm',
  large: 'logo-lg',
};

export const Logo: React.FC<LogoProps> = ({ size, type, color = 'primary', className }) => {
  const classes = classNames(
    'logo',
    className,
    { [`${logoSize[size]}`]: size },
    { [`logo-${type}`]: type },
    { [`logo-${color}`]: color }
  );

  return (
    <div className={classes}>
      {(type === 'icon' || type === 'both') && <LogoIconSvg size={size} />}
      {(type === 'text' || type === 'both') && <LogoTextSvg size={size} />}
    </div>
  );
};

